Finding count of documents grouped by Today, This Week , This Month<p>I am using Redash to perform data visualization and I  have documents that have a structure like:</p>

<pre><code>{
"id" : "12345",
"created_at" : "07/06/19 08:53"
},
{
"id" : "123456",
"created_at" : "07/06/19 12:13" 
},
{
"id" : "123457",
"created_at" : "06/06/19 20:18"
}
</code></pre>

<p>What I want as the result is </p>

<pre><code>{
"TimeRange" : "today",
"count" : "6"
},
{
"TimeRange" : "this Week",
"count" : 15
},
{
"TimeRange" : "this Month",
"count" : 40
}
</code></pre>

<p>I can group by dates using </p>

<pre><code>db.doc.aggregate([
     { $group: 
        { _id: { $dateToString: { format: "%Y-%m-%d", date: "$created_at" } }, count: { $sum: 1 } } }
])  
</code></pre>

<p>But is there any way preferably using aggregations to display the result in different time ranges as specified?</p>

