Mongodb aggregate query $skip $limit issues<p>I've got a query I call on from my app, to provide me with paged results from my db</p>

<pre><code>const query = [
  {
    "$match" : {
      "$or" : [
        { "expires_at" : { "$gt" : moment().toISOString() }},
        { "expires_at" : null }
      ],
      "vendor_category" : {
        "$nin" : ignoredCategories
      }
    }
  },
  {
    "$lookup": {
      "from": models.retailers.collection.name,
      "localField": "retailer",
      "foreignField": "_id",
      "as": "retailer"
    }
  },
  {
    "$lookup": {
      "from": models.categories.collection.name,
      "localField": "category",
      "foreignField": "_id",
      "as": "category"
    }
  },
  {
    "$sort": {
      "category.popularity" : -1,
      ...sortBy
    }
  },
  { "$unwind": "$retailer" },
  { "$unwind": "$category" },
  { "$skip" : skip },
  { "$limit" : limit }
]
</code></pre>

<p>This mostly works, my two <code>$lookup</code> and <code>$unwind</code> objects join the other collections to the results and my <code>$sort</code> object correctly sorts the root query by the products category popularity.</p>

<p>However my <code>$match</code> object only returns about 18 (of 72) results. Which would be fine except that when i run <code>const total = await models.products.countDocuments(query[0].$match)</code>, so count the documents using that match query, i get 72. So There is a mismatch between the two.</p>

<p>So what is happening to the rest of the results? Am i doing something wrong in this query? This is definitely the first aggregate query i've written, so maybe i'm just completely missing something. Any tips / questions / optimizations are welcomed! If you need any more info let me know.</p>

<p><strong>Edit</strong>
Here is an example of the match query expanded. When i was using <code>Model.find</code> with this it was working fine, but since i've been isolating parts of the query this seems to be the culprit. The intent is to only pull results that have an expire time greater than the current time, or the field is null. The data comes from a scraper and sometimes i don't have the expires data. I also exclude a string of categories, this is a safeguard from displaying items that make it through the scraper but i don't want on the site.</p>

<pre><code>$match : {
       $or : [
         { expires_at : { $gt : moment().toISOString() }},
         { expires_at : null }
      ],
      vendor_category : {
        $nin : [ 'ID-6',   'ID-8', 'ID-283', 'ID-288', 'ID-354', 'ID-513', 'ID-654', 'ID-659', 'ID-33', 'ID-450', 'ID-497',  'ID-59', 'ID-404', 'ID-337']
      }
    }
</code></pre>

