ReactiveAggregate() + collection.update() -> Error: Expected to find a document to change<p>The reactive aggregation is published to the client initially without errors. The error seems to be triggered, when the <code>Meteor.user</code> collection is being updated by a <code>Meteor.call()</code> from the client:</p>

<pre><code>updateProductFavorites = (product_key, action) =&gt; {
    const { ranking } = this.props
    const { product_keys } = ranking[0]
    Meteor.call('Accounts.updateProductFavorites', product_key, action, (err, response) =&gt; {
        if (err)
            makeAlert(err.reason, 'danger', 3000)
        else 
            this.getProductsByKeys(product_keys)    
    })
}
</code></pre>

<p>I have subscribed to both the <code>Meteor.user()</code> and the reactive aggregation:</p>

<pre><code>export default withTracker(() =&gt; {
    const handle = Meteor.subscribe("products.RankingList")
    return {
        ranking: AggregatedProductRanking.find({}).fetch(),
        user: Meteor.user(),
        isLoading: !handle.ready() || !Meteor.user()
    }
})(ProductRankingList)
</code></pre>

<p>I have declared and imported the <code>clientCollection</code> on both sides, as also suggested in this <a href="https://stackoverflow.com/a/39795054/8412038">answer</a>. This is the relevant code on the server side:</p>

<pre><code>const getProductRankingList = (context) =&gt; ReactiveAggregate(context, Meteor.users, [
      // aggregation stages can be seen in the code snippet below
    ], { clientCollection: "aggregatedProductRanking"})

Meteor.methods({
    'Accounts.updateProductFavorites': function(product_key, action) {
         allowOrDeny(this.userId)
         action = action == 'add' ? { $addToSet: { productFavorites: product_key }} : { $pull: { productFavorites: product_key }}
         return Meteor.users.update({_id: this.userId}, action)
     }
})

Meteor.publish('products.RankingList', function() {
    const callback = () =&gt; this.stop()
    allowOrDenySubscription(this.userId, callback)
    return getProductRankingList(this)
})
</code></pre>

<p>What baffles me, is that the <code>update</code> called by <code>Meteor.call('Accounts.updateProductFavorites')</code> is still executed reliably, even with this error being thrown.</p>

<p>So the change to the logged in <code>Meteor.user()</code> flows back to the client and the component rerenders. Only the subscription of the ReactiveAggregate seems to stop working. The following error is thrown and I have to reload the browser to see the changes in the aggregation result. (full stack trace at the bottom)</p>

<pre><code>Uncaught Error: Expected to find a document to change
    at Object.update (collection.js:207)
    at Object.store.&lt;computed&gt; [as update] (livedata_connection.js:310)
    ...

// In a certain case the error message is a bit different:
Exception in flushing DDP buffered writes: Error: Expected to find a document to change
    at Object.update (collection.js:207)
    at Object.store.&lt;computed&gt; [as update] (livedata_connection.js:310)
    ...
</code></pre>

<p>I am guessing that this <code>update()</code> is called by the <code>ReactiveAggregate()</code> in order to populate the <code>clientCollection</code>. <strong><em>But what am I doing wrong?</em></strong></p>

