<pre><code>{
    _id
    someParamA,
    someParamB,
    someParamC: {
        nestedParamA,
        nestedParamB,
        nestedParamC,
    }
}
</code></pre>

<p>what I'm trying to do is query the DB and return all records that have one of a view different values for someParamC. </p>

<p>For example, the query would be something like: </p>

<p>WHERE (someParamC: { nestedParamA: 1, nestedParamB: 1, nestedParamC: 1}) OR (someParamC: { nestedParamA: 1, nestedParamB: 1, nestedParamC: 2}</p>

<p>I've tried this with code like:</p>

<pre><code>Collection.find().or([{someParamC: {...}}, {someParamC: {...}}]
</code></pre>

<p>Which, per the Mongoose debugging messages produces a query like this:</p>

<pre><code>{
  "dbQuery": {
    "coll":  "collectionName","method":"find","query": {"$or":[{"someParamC":{...}},{"someParamC":{...}]},"doc":{"sort":{"updatedAt":-1},"projection":{}}
  }
}
</code></pre>

<p>Which is exactly what I would expect it to be. Even though the collection has multiple matching documents, Mongoose is always returning [].</p>

<p>I have also tried putting the filter inside the .find() method as { $or:  } to no avail. This all also failed when calling .findOne(). Am I doing something wrong here? My specific code, collection, and logging are as follows:</p>

<pre><code>cacheResult = await resultsCollection.find()
  .or(&lt;array of parameters, see below&gt;)
  .sort({ updatedAt: -1 });
</code></pre>

<p>the array of parameters looks like this:</p>

<pre><code>[
  {
    "requestParameters":{
      "action":"product",
      "domainId":1,
      "ASIN":"B0763ZCH7K",
      "offers":true,
      "rating":true
    }
  },
  {
    "requestParameters":{
      "action":"product",
      "domainId":1,
      "ASIN":"B0763ZCH7K",
      "offers":true,
      "rating":false
    }
  },
  {
    "requestParameters":{
      "action":"product",
      "domainId":1,
      "ASIN":"B0763ZCH7K",
      "offers":false,
      "rating":true
    }
  },
  {
    "requestParameters":{
      "action":"product",
      "domainId":1,
      "ASIN":"B0763ZCH7K",
      "offers":false,
      "rating":false
    }
  }
]
</code></pre>

<p>Which generates this request (Mongoose debugging information):</p>

<pre><code>{
  "dbQuery":{
    "coll":"public.keepas",
    "method":"find",
    "query":{
      "$or":[
        {
          "requestParameters":{
            "action":"product",
            "domainId":1,
            "ASIN":"B0763ZCH7K",
            "offers":true,
            "rating":true
          }
        },
        {
          "requestParameters":{
            "action":"product",
            "domainId":1,
            "ASIN":"B0763ZCH7K",
            "offers":true,
            "rating":false
          }
        },
        {
          "requestParameters":{
            "action":"product",
            "domainId":1,
            "ASIN":"B0763ZCH7K",
            "offers":false,
            "rating":true
          }
        },
        {
          "requestParameters":{
            "action":"product",
            "domainId":1,
            "ASIN":"B0763ZCH7K",
            "offers":false,
            "rating":false
          }
        }
      ]
    },
    "doc":{
      "sort":{
        "updatedAt":-1
      },
      "projection":{

      }
    }
  }
}
</code></pre>

<p>Which returns [], even though, this is in the database:
<a href="https://i.stack.imgur.com/ozmxi.png" rel="nofollow noreferrer">Screen shot of some DB records that should match</a></p>

<p>Any help is greatly appreciated!</p>

