How to translate NOT (A AND B) into a mongodb query<p>I've built a grammar (using peg.js) to support simple search queries in a Node.js web-application; I need to translate the AST it produces into a <code>$match</code> parameter for a MongoDB aggregate function. Most cases are fine, but I'm having trouble figuring out what <code>NOT (A AND B)</code> should look like in MongoDB.</p>

<p>Some example data:</p>

<pre><code>{ _id:123, labels:['a', 'b', 'c'], tags:['g', 'h', 'i']},
{ _id:456, labels:['a', 'e', 'f'], tags:['i', 'j', 'k']},
{ _id:789, labels:['c', 'd', 'b'], tags:['h', 'l', 'm']}
</code></pre>

<p>A user might type in the query <code>NOT (labels:a AND labels:b)</code>, or <code>NOT (labels:b AND tags:h)</code> which are both valid queries, based on my grammar. </p>

<p>The intent for the first query would be to bring back all documents that do not contain both 'a' and 'b' in their <code>labels</code> field (so the second and third document would be returned); for the second query, it should match all documents that do not contain both 'b' in the <code>labels</code> field, and 'h' in the <code>tags</code> field. </p>

<p>MongoDB's <code>$not</code> operator doesn't seem to allow you to neatly negate a logical operation in the way I'm looking for; ideally, I'd like to do something like:</p>

<pre><code>{
    $not: {
        $and: [
            { labels: a},
            { labels: b},
        ]
    }
}
</code></pre>

<p>or</p>

<pre><code>{
    $not: {
        $and: [
            { labels: b},
            { tags: h},
        ]
    }
}
</code></pre>

<p>Is there some other operator I can use to do this? Also, ideally, this would be something easy to build programatically - so that I could build a potentially complex compound query inside the parentheses, and then just negate it if there was a <code>NOT</code>.</p>

<p><strong>EDIT</strong>: Expanded the dataset, and expanded and clarified my actual requirements for an answer.</p>

